import React from 'react';
import Main from "./components/Main";
import Header from "./components/Wrapper";
import Wrapper from "./components/Header";


function App() {
  return (
    <div className="App">
      <Wrapper>
        <Header />
        <Main />
      </Wrapper>
    </div>
  );
}

export default App;
